N = len(raw_sig)
H = np.zeros(N)
l = int(30 * 1.6)

window = moving_window(raw_sig, 30, 1.6, 0.8)
for enum, each_window in enumerate(window):
    normalized = normalize(each_window, framework='CHROM')

    Xs = 3 * normalized[0] - 2 * normalized[1]
    Ys = 1.5 * normalized[0] + normalized[1] - 1.5 * normalized[2]

    Xf = butterworth_bp_filter(signal=Xs, fps=30, low=0.67, high=4.0, order=3)
    Yf = butterworth_bp_filter(signal=Ys, fps=30, low=0.67, high=4.0, order=3)

    # Xf = fir_bp_filter(signal=Xs, fps=30, low=0.67, high=2.0)
    # Yf = fir_bp_filter(signal=Ys, fps=30, low=0.67, high=2.0)

    alpha = np.std(Xf) / np.std(Yf)
    S = Xf - alpha * Yf

    SWin = np.multiply(S, hann(len(S)))

    start = enum*(l//2)
    end = enum*(l//2) + l

    if end > len(raw_sig):
        H[len(raw_sig)-48:len(raw_sig)] = H[len(raw_sig)-48:len(raw_sig)] + SWin
    else:
        H[start:end] = H[start:end] + SWin

